import axios from "axios";

export const getUserActivities = () => async (dispatch) => {
  const response = await axios.get("http://localhost:3001/activities");
  console.log(response);

  dispatch({
    type: "GET_USER_ACTIVITIES",
    payload: response,
  });
};
